import './App.css';
import profileImg from './img/myself.jpg'

function App() {
  return (
    <div id='App'>
      <h1> My React App</h1>
      <h2> Author: Nathan Xuan</h2>
      <img src = {profileImg} id='profile'></img>
    </div>

  );
}

export default App;
